import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Sales() {

  const [mydata, setdata] = useState([]);

  useEffect(() => {
    axios
      .get('http://127.0.0.1:8000/project/sales/')
      .then((res) => setdata(res.data));
  }, []);

  return (
    <>
      <h1>Sales Data</h1>
      
      {mydata.map((sales) => {
        const { customer_id, sales_date } = sales;
        return (
          <div key={customer_id}>
            <h2>{customer_id}</h2>
            <br/>
            <h2>{sales_date}</h2>
          </div>
        );
      })}
    </>
  );
}

export default Sales;
